  const [height, setHeight] = useState("")
  return (
    <View style={styles.container}>
      <View style={{
        width: '100%',
        padding: 10,
      }}>
        <Text>Height(kg.)</Text>
        <TextInput
          style={styles.height}
          onChangeText={setHeight}
          value={he}
        />
        <Text>Weight(cm.)</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: "center",
    padding: 30,
    width: '100%'
  },
  height: {
    height: 40,
    width: "100%",
    borderWidth: 0.5,
    borderColor: "lightgray",
